syntax = "proto3";

option java_package = "emu.grasscutter.net.proto";


// Name: LAELNKCMNMP
message LAELNKCMNMP {
    // Name: KPPCAMMJJIO
    message RequestInfo {
        bool is_taken_reward = 3;
        uint32 request_id = 7;
        uint32 quest_id = 2;
    }

    bool is_open = 12;
    repeated RequestInfo PFAPMICLFPH = 2;
}

